import React, { useState, useEffect } from 'react'
import {
  Card,
  CardBody,
  CardHeader,
  CardTitle,
  Col,
  Dropdown,
  DropdownItem,
  DropdownMenu,
  DropdownToggle,
  Row,
} from 'reactstrap'

// Importar os componentes do gráfico
import StaticSunBurst from '../buildCharts/sunBurstChart/StaticSunBurst'
import StaticStackedBar from '../buildCharts/stackedBarChart/StaticStackedBar'
import StaticTimeLine from '../buildCharts/timeLineChart/StaticTimeLine'
import StaticPie from '../buildCharts/pieChart/StaticPie'
import StaticPie1 from '../buildCharts/pieChart/StaticPie1'
import StaticBoxPlot from '../buildCharts/boxPlotChart/StaticBoxPlot'
import StaticWordCloud from '../buildCharts/wordCloudChart/StaticWordCloud'

const ChooseCharts = ({
  title = 'My chart???',
  data,
  activeLabel,
  showChart,
}) => {
  const [activeChart, setActiveChart] = useState(activeLabel)
  const [chartTitle, setChartTitle] = useState(title)
  const [dropdownOpen, setDropdownOpen] = useState(false)

  useEffect(() => {
    if (!data) {
      setChartTitle('No chart to show')
    } else {
      setChartTitle(title)
    }
  }, [activeChart, title, data])

  const toggleDropdown = () => {
    setDropdownOpen((prevState) => !prevState)
  }

  const handleSelect = (eventKey) => {
    setActiveChart(eventKey)
  }

  const renderActiveChart = () => {
    switch (activeChart) {
      case 'SunBurst':
        return data ? <StaticSunBurst data={data} /> : <p>No data available</p>
      case 'BoxPlot':
        return data ? <StaticBoxPlot data={data} /> : <p>No data available</p>
      case 'WordCloud':
        return data ? <StaticWordCloud data={data} /> : <p>No data available</p>
      case 'StackedBar':
        return data ? (
          <StaticStackedBar data={data} />
        ) : (
          <p>No data available</p>
        )
      case 'TimeLine':
        return data ? <StaticTimeLine data={data} /> : <p>No data available</p>
      case 'PieChart1':
        return <StaticPie />
      case 'PieChart2':
        return <StaticPie1 />
      default:
        return null
    }
  }

  return (
    <Card
      className="card-chart"
      style={{
        maxWidth: '100%',
        height: '450px',
        backgroundColor: '#27293d',
        overflow: 'hidden',
        display: 'flex',
        flexDirection: 'column',
      }}
    >
      <CardHeader
        style={{
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
          padding: '10px 20px',
        }}
      >
        <CardTitle
          style={{
            color: 'burlywood',
            margin: 0,
            whiteSpace: 'nowrap',
            overflow: 'hidden',
            textOverflow: 'ellipsis',
          }}
        >
          {chartTitle}
        </CardTitle>
        <Dropdown
          isOpen={dropdownOpen}
          toggle={toggleDropdown}
          style={{
            width: 'auto',
            maxWidth: '100%',
          }}
        >
          <DropdownToggle>Choose a Chart</DropdownToggle>
          {showChart && (
            <DropdownMenu
              style={{
                position: 'absolute',
                right: 0,
                top: '100%',
                width: '200px', // Define uma largura para o menu
                maxWidth: '100%',
              }}
            >
              <DropdownItem onClick={() => handleSelect('SunBurst')}>
                SunBurst
              </DropdownItem>
              <DropdownItem onClick={() => handleSelect('BoxPlot')}>
                BoxPlot
              </DropdownItem>
              <DropdownItem onClick={() => handleSelect('WordCloud')}>
                WordCloud
              </DropdownItem>
              <DropdownItem onClick={() => handleSelect('StackedBar')}>
                Stacked Bar
              </DropdownItem>
              <DropdownItem onClick={() => handleSelect('PieChart1')}>
                Pie Chart 1
              </DropdownItem>
              <DropdownItem onClick={() => handleSelect('PieChart2')}>
                Pie Chart 2
              </DropdownItem>
            </DropdownMenu>
          )}
        </Dropdown>
      </CardHeader>
      <CardBody
        style={{
          color: 'burlywood',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          padding: 0,
          overflow: 'hidden',
        }}
      >
        {renderActiveChart()}
      </CardBody>
    </Card>
  )
}

export default ChooseCharts
